import React from "react";
import styled from "styled-components";

const Cards = styled.div`
  font-size: 17px;
  width: 12%;
  display: flex;
  justify-content: center;
  align-items: center;
  background: #f2f2f2;
  height: 69%;
  border-radius: 11px;
`;

export default function LabelCard(props) {
  return <Cards>{props.label}</Cards>;
}
